def translate_to_portuguese(text):
    translator = Translator()
    t = translator.translate(text, dest='pt', src='en')
    return t.text

def collapse_list_values(row):
    for key, value in row.items():
        if isinstance(value, list):
            row[key] = '|'.join(value)
    return row
